import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import ProfileSkills from './ProfileSkills'
import ProfileHeader from './ProfileHeader'
import WorkExperiences from './WorkExperiences'
import Education from './Education'
import Footer from './Footer'

class App extends Component {
  constructor(args) {
    super(args)
    this.userData={

        "profile": {
           "image": "https://raw.githubusercontent.com/b2w-marketplace/code-challenge/master/files/avatar-dev.png",
           "name": "Brian Walker",
           "profession": "Web Developer",
           "description": "27-year old web developer fromt Colorado Springs with 5+ years of work experience in various fields",
           "contact": {
               "tel": "123-456-7890",
               "cel": "012-345-6789",
               "address": "1490 General Woods. Colorado Springs",
               "website": "brianwalker.co",
               "mail": "mail@brianwalker.co" 
           },
           "skills": [{
               "name": "Front End",
               "value": "80%",
               "color": "red"
           },
           {
               "name": "Back End",
               "value": "90%",
               "color": "blue"
           },
           {
               "name": "Writing",
               "value": "75%",
               "color": "pink"
           }] ,
           "experience": [{
                "name": "Front End Developer @ HillSong",
                "date": "January 2014",
                "description": "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley."
           },
           {
                "name": "PHP Developer @ Creative Wizards",
                "date": "March 2012 - December 2013",
                "description": "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley."
           },
           {
                "name": "UX Designer @ Graphics MasterMinds",
                "date": "January 2012 - February 2012",
                "description": "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley."
           }],
           "education": [{
                "name": "Web Developer @ Harvard University",
                "date": "August 2006 - May 2010",
                "description": "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley."
           },
           {
                "name": "Colorado Springs College",
                "date": "August 2003 - May 2006",
                "description": "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley."
           },
           {
                "name": "UX Designer @ Graphics MasterMinds",
                "date": "January 2012 - February 2012",
                "description": "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley."
           }]

       }
    }
  }

  render() {
    return (
      <div className="App">
      <div id="main-wrapper">
        <div className="columns-block container">
           <div className="left-col-block blocks">
              <header className="header theiaStickySidebar">
                 <div className="content">
                    <ProfileHeader profileData={this.userData.profile}/>
                    <ProfileSkills skills={this.userData.profile.skills} />
                 </div>
              </header>
           </div>
           <div className="right-col-block blocks">
              <div className="theiaStickySidebar">
                 <section className="section-wrapper section-interest gray-bg">
                    <div className="container-fluid">
                       <WorkExperiences experiences={this.userData.profile.experiences}/>
                       <Education />
                    </div>
                 </section>
                 <Footer />
              </div>
           </div>
        </div>
      </div>
    </div>
    );
  }
}

export default App;
